import React from "react";

function Checkbox({ checked, children }) {
  return (
    <div>
      <label>
        <input type="checkbox" />
        <div>{checked ? "checked" : "not chcked"}</div>
      </label>
      <span>{children}</span>
    </div>
  );
}

export default Checkbox;
